// Crear una instancia de Vue
const app = Vue.createApp({
    data() {
      return {
        count: 0
      };
    },
    methods: {
      increment() {
        this.count++;
      }
    }
  });

  // Montar la aplicación en el elemento con id 'app'
  app.mount('#app');
